import React from 'react';


import {
    Container
   } from 'reactstrap';

const SlideFirst  = () => {

  return (
    <div className="SlideFirst">

        <Container>
        <h1>First Slide</h1>
        </Container>
    </div>
  );
}

export default SlideFirst ;
